// this imports reactstrap components defined in the render method
import { Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  Container,
  Row,
  Col,
  Jumbotron,
  Button } from 'reactstrap';

  import {Component} from 'react';

  class App extends Component {
    constructor(props) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
            isOpen: false
        };
    }
    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }
    render() {
        return (
            <div>
                <Navbar color="inverse" light expand="md">
                    <NavbarBrand href="/">Picture Perfect</NavbarBrand>
                    <NavbarToggler onClick={this.toggle} />
                    <Collapse isOpen={this.state.isOpen} navbar>
                        <Nav className="ml-auto" navbar>
                            <NavItem>
                                <NavLink href="/Templates/">Templates</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink href="https://instagram.com" target="_blank">Instagram</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink href="/Templates/">saved template work</NavLink>
                            </NavItem>
                        </Nav>
                    </Collapse>
                </Navbar>
                <Jumbotron>
                    <Container>
                        <Row>
                            <Col>
                                <h1>Lets Make A Memory!</h1>
                                <p>
                                    <Button
                                        tag="a"
                                        color="success"
                                        size="large"

                                        target="_blank"
                                    >
                                        Create
                                    </Button>
                                    	<div> <button  type="button" data-name="${name}" data-image="${img}" data-address="${address}" data-rating="${aggregate_rating}"  data-description="${cuisines}" data-menu="${menu_url}" id="print" class="addRestaurant btn">Save</button> </div>
                                </p>
                            </Col>
                        </Row>
                    </Container>
                </Jumbotron>
            </div>
        );
    }
}

export default App;
